typedef vector<double> vi;

pair<vi, vi> div(vi p1, vi p2) {
	vi quoc, resto;
	int a = p1.size(), b = p2.size();
	for (int i = 0; i <= a - b; i++) {
		double k = p1[i] / p2[0];
		quoc.pb(k);
		for (int j = i; j < i + b; j++)
			p1[j] -= k * p2[j - i];
	}

	for (int i = a - b + 1; i < a; i++)
		resto.pb(p1[i]);

	return {quoc, resto};
}

int vai(vi a, vi b) {
	if (a.size() < b.size()) swap(a, b);
	int anss = 0;
	if (b.size() == 1 and b[0] == 0) return 0;
	while (1) {
		anss++;
		auto d = div(a, b);
		

		

		

		

		

		a = b;
		b = d.s;
		if (!b.size()) b.pb(0);
		while (b.size() > 1 and abs(b[0]) < 1e-9) b.erase(b.begin());
		if (b.size() == 1 and abs(b[0]) < 1e-9) break;
	}
	return anss;
}



void printa(int i) {
	cout << ans[i].size()-1 << endl;
	reverse(ans[i].begin(), ans[i].end());
	for (int j : ans[i]) cout << j << " ";
	cout << endl;
}

int main() { _
	srand(13);
	int n; cin >> n;
	if (n <= 69) {
		while (1) {
			vector<double> a(rand()%n+2);
			vector<double> b(rand()%(a.size()-1)+1);
			a[0] = 1, b[0] = 1;
			for (int i = 1; i < a.size(); i++) a[i] = (rand()%3)-1;
			for (int i = 1; i < b.size(); i++) b[i] = (rand()%3)-1;
			for (auto& i : b) i = 1;
			if (vai(a, b) == n) {
				reverse(a.begin(), a.end());
				reverse(b.begin(), b.end());
				cout << a.size()-1 << endl;
				for (auto i : a) cout << i << " ";
				cout << endl;
				cout << b.size()-1 << endl;
				for (int i : b) cout << i << " ";
				cout << endl;
				return 0;
			}
		}

	}
	n--;
	n -= 69;
	printa(2*n);
	printa(2*n+1);
	exit(0);
}
